class Solution(object):
    def productExceptSelf(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        result = []
        i = 1
        for x in range(len(nums)):
            result.append(i)
            i = i * nums[x]
        j = 1
        for y in range(len(nums) - 1, -1, -1):
            result[y] = result[y] * j
            j = j * nums[y]
        return result

